@SiteJamesons O pior dessa thread inteira é que efetivamente o Slott criou um Doctor na Marvel: o Surfista citado no fio.
E essa versão meio que consegue unir a ideia original do Jack Kirby, real criador do personagem com o que Stan Lee fez depois.
Rolou até treta por isso.

@lsisIncarnate || Doctor who? 

Well if Cleopartra wants travel anywhere and everywhere. Regardless of space and time. If you like adventure, I can promise you an abundance of it, touching alien sands and hear the cries of strange birds, and all inside a blue box. 

... And a lot of running. https://t.co/MzmAvWGV0x

